  `pagesize` varchar(5) DEFAULT '' COMMENT '每页显示数据条数',
  `group_button_status` tinyint(4) DEFAULT NULL COMMENT '按钮组显示状态',
  `list_button_status` tinyint(4) DEFAULT NULL COMMENT '按钮是否显示列表',
  `button_color` varchar(20) DEFAULT NULL,
