#
# Structure for table "cd_louyu"
#

CREATE TABLE `cd_louyu` (
  `louyu_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `shop_id` int(11) DEFAULT NULL COMMENT '所属物业',
  `xqgl_id` int(11) DEFAULT NULL COMMENT '所属小区',
  `louyu_pid` int(11) DEFAULT NULL COMMENT '楼宇单元',
  `louyu_name` varchar(250) DEFAULT NULL COMMENT '楼宇名称',
  `louyu_dysl` smallint(6) DEFAULT NULL COMMENT '单元数量',
  `louyu_lczs` smallint(6) DEFAULT NULL COMMENT '楼层总数',
  `louyu_chzs` smallint(6) DEFAULT NULL COMMENT '层户总数',
  `louyusx_id` smallint(6) DEFAULT '1' COMMENT '楼房属性',
  `louyu_flcs` smallint(6) DEFAULT NULL COMMENT '负楼层数',
  `louyu_jzsj` int(10) DEFAULT NULL COMMENT '建筑时间',
  `louyu_jzmj` decimal(10,2) DEFAULT '1.00' COMMENT '建筑面积',
  `louyu_jsdw` varchar(250) DEFAULT NULL COMMENT '建设单位',
  `louyu_dtsl` smallint(6) DEFAULT NULL COMMENT '电梯数量',
  `louyutype_id` smallint(6) DEFAULT '1' COMMENT '楼宇类型',
  `louyu_dscs` smallint(6) DEFAULT NULL COMMENT '底商层数',
  `louyu_ycjh` smallint(6) DEFAULT NULL COMMENT '一层几户',
  `louyu_lyqz` varchar(250) DEFAULT NULL COMMENT '楼宇前缀',
  PRIMARY KEY (`louyu_id`)
) ENGINE=InnoDB AUTO_INCREMENT=635 DEFAULT CHARSET=utf8;

